import React from 'react';
import Selected from '../Selected/Selected';
import Subscribe from '../Subscribe/Subscribe';
import Footer from '../Footer/Footer';

class Cart extends React.Component {
	render() {
		return (

			<React.Fragment>
			<div>Cart</div>
		        <Slideshow />
		        <Newproducts />
		        <Selected />
		        <Service />
		        <Todayproducts />
		        <Subscribe />
		        <Footer />
      		</React.Fragment>
		)
	}
}

export default Cart;
